    false,nt"url": null,nt"notes": "Because of continuing concern over the
    decline of grassland bird populations in the Northeast, and the fact that many management
    activities designed to increase grassland habitat were undertaken in 1996 and 1997,
    tis study was funded for 1989 and 1999 for areas that included Iroquois National
    Wildlife Refuge, Montezuma National Wildlife Refuge and portions of the St. Lawrence
    Wetlands and Grassland Management District in Jefferson County, New York. This report
    is not meant to be a comprehensive document on grassland bird ecology and management
    in the study area, but rather a discussion of: 1) Recent grassland bird population
    trends at Iroquois and Montezuma National Wildlife Refuges 2) Effects of recent
    United States Fish and Wildlife Service management activities on grassland birds
    and their habitat; 3) Abundance of grassland birds, especially Henslow's Sparrow
    in the Jefferson County area of the St. Lawrence River Valley.",nt"license_title":
